import React, {Component} from 'react';
import CardList from './CardList';
import { robots } from './robots';
import Searchbox from './Searchbox';

class App extends Component {
	render() {
		return(
		<div>
			<h1>Robofriends</h1>
			<Searchbox />
			<CardList robots = {robots}/>
		</div>
	);
	}

}

export default App;
